DROP TABLE IF EXISTS `iie_banner`;
CREATE TABLE `iie_banner` (
  `id` int(11) NOT NULL COMMENT 'id',
  `accuracy` int(11) DEFAULT NULL COMMENT '指纹准确度，值范围0~100，越高表示越准确',
  `device_category` varchar(50) DEFAULT NULL COMMENT '设备大类,也就是设备一级类型',
  `device_type` varchar(50) DEFAULT NULL COMMENT '设备二级类型',
  `brand` varchar(50) NOT NULL COMMENT '设备品牌',
  `model` varchar(50) DEFAULT NULL COMMENT '设备型号',
  `server` varchar(100) DEFAULT NULL COMMENT '响应头中的server字段值',
  `www_authenticate` varchar(200) DEFAULT NULL COMMENT '响应头中的www_authenticate字段值',
  `title` varchar(100) DEFAULT NULL COMMENT '响应体中的title字段值',
  `others` varchar(200) DEFAULT NULL COMMENT '其它设备信息,包含匹配时使用该字段',
  `match_type` int(11) DEFAULT NULL COMMENT '精确匹配还是包含',
  `protocol` varchar(30) NOT NULL COMMENT '提取该指纹的应用层协议,Note:如果是私有协议，则采用传输层协议+端口命名,如37777，可以命名为TCP37777',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='设备指纹存放表格';

